import React, { useState } from 'react';
import axios from 'axios';
import './ReservationPage.css';

const ReservationPage = () => {
    const [formData, setFormData] = useState({
        name: '',
        email: '',
        checkIn: '',
        checkOut: '',
        roomType: 'SINGLE',
        roomPrice: 695,
        phone: '',
        message: '',
    });

    const handleChange = (e) => {
        setFormData({ ...formData, [e.target.name]: e.target.value });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const response = await axios.post('http://localhost:5000/api/reservations', formData);
            alert('Reservation submitted successfully!');
            setFormData({
                name: '',
                email: '',
                checkIn: '',
                checkOut: '',
                roomType: 'SINGLE',
                roomPrice: 695,
                phone: '',
                message: '',
            });
        } catch (error) {
            alert('Error submitting reservation');
        }
    };

    return (
        <div className="reservation-page">
            <h1>Hotel_Name Reservation Form</h1>
                 <form className="hotel-booking-form" onSubmit={handleSubmit}>
            <div className="form-section">
        <label>Check-in Date</label>
        <input type="date" name="checkIn" value={formData.checkIn} onChange={handleChange} required />
     </div>

    <div className="form-section">
        <label>Check-out Date</label>
        <input type="date" name="checkOut" value={formData.checkOut} onChange={handleChange} required />
    </div>

    <div className="form-section">
        <label>Total Days</label>
        <input type="text" name="totalDays" value={formData.totalDays} readOnly />
    </div>

    <div className="form-section">
        <label>Apartment</label>
        <input type="text" name="apartment" value="NEW YORK GUEST & BAR - Wellawatte, Colombo 06" readOnly />
    </div>

    <div className="form-section">
        <label>Room Type</label>
        <input type="text" name="roomType" value={formData.roomType} readOnly />
    </div>

    <div className="form-section">
        <label>Room</label>
        <select name="room" value={formData.room} onChange={handleChange}>
            <option value="">No rooms available in this room type</option>
        </select>
    </div>

    <div className="form-section">
        <label>Amount</label>
        <input type="number" name="amount" value={formData.amount} onChange={handleChange} required />
    </div>

    <div className="form-section">
        <label>Service Charge (10% of Amount)</label>
        <input type="text" name="serviceCharge" value={formData.serviceCharge} readOnly />
    </div>

    <div className="form-section">
        <label>Refundable Charge (if Long Term = 50% of Amount)</label>
        <input type="text" name="refundableCharge" value={formData.refundableCharge} readOnly />
    </div>

    <div className="form-section">
        <label>Total Amount</label>
        <input type="text" name="totalAmount" value={formData.totalAmount} readOnly />
    </div>

    <button type="submit">Submit Reservation</button>
    <button type="button" onClick={resetForm}>Reset All Fields</button>
</form>

        </div>
    );
};

export default ReservationPage;
